from Naive1044 import Solution as naive
from BinarySearch_RabinKarp1044 import Solution as rabinkarp

testcase = [
    ('banana', 'ana'),
    ('abcd', ''),
    ('', ''),
    ('', 'maoli')
]


def test_naive():
    for S, ans in testcase:
        assert naive().longestDupSubstring(S) == ans


def test_rabinkarp():
    for S, ans in testcase:
        assert rabinkarp().longestDupSubstring(S) == ans
